import React from 'react';

const Events = () => {
  const allEvents = [
    { id: 1, title: "HackUCI", description: "24-hour hackathon event open to all UCI students." },
    { id: 2, title: "Environmental Club Cleanup", description: "Help us clean up the campus park this weekend!" },
    { id: 3, title: "Art Exhibit", description: "Explore art by UCI students and local artists." },
  ];

  return (
    <div>
      <h1>Events at UCI</h1>
      {allEvents.map((event) => (
        <div key={event.id} className="event-card">
          <h3>{event.title}</h3>
          <p>{event.description}</p>
          <button>RSVP</button>
        </div>
      ))}
    </div>
  );
};

export default Events;
